import React from 'react';
import { link } from 'react-router-dom';

function nav() {
  return (
    <nav id="main-nav" class="nav">
      <ul id='main-links' class='links'>
        <li>Home</li>
        <li>Schools</li>
      </ul>
    </nav>
  );
}

export default nav;
